def geocode(litter)
  address = litter_location
  result = Geocoder.search(address).first
  process_geocoded_result(result, litter) if result
end

def process_geocoded_result(result, litter)
  location = Location.new litter_id: litter.id                  #create location and assign it to the litter that belongs to that location
  location.latitude = result.latitude
  location.longitude = result.longitude
  location.save
end

def random_user_id
  User.ids.sample    # gives me a random user
end

100.times do
  litter = Litter.create amount: rand(1..5), cleaned: false, user_id: random_user_id
  geocode(litter)
end
